import Main from './components/Main'

const About = () => {
  return (

      <div className='main-top'>
         <div className='about'>
        <h1>We started in 2001 with the goal of making the #1 store in the world which sells every item you could possibly want (this includes illegal stuff). We have definitely met and surpassed this goal, as impossible as that sounds.
     </h1> </div></div>

  );
};

export default About;
